    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Detroit Lakes Wetlands Management District for
    the next 15 years. This plan outlines the District vision and purpose and describes
    how Detroit Lakes Wetlands Management District will contribute to the overall mission
    of the Refuge System. The plan provides an introduction to the WMD an overview of
    the CCP process, information about the environment, information about the management
    direction, and strategies for implementation. Key planning issues include: wildlife
    management, habitat management, public use, and operations.",nt"owner_org":
